widgets.label:
#{
@{this} ? "HORS ANTENNE" : "À L'ANTENNE"
}

widgets.colorWidget:
JS{{
var v = @{this}
if (v<10) return "auto"
if (v<20) return "pink"
if (v<30) return "cyan"
if (v<40) return "yellow"
if (v<50) return "#ff9555"
if (v<=60) return "red"
}}

widgets.script:
var target='192.168.1.101:3819'

if (value.length) {

var on = value.some(x=>x==1)

for (var i = 0; i < 12; i++) {
  send(target, "@{this.address}",
       @{parent.variables.n},
       @{parent.variables.piid},
       i + 10,
       on ? value[i] : 1)
}

}

widgets.css:
JS{{
if (!@{service_ip}) return `

.frame-container inner:after {
content:"service ip not set";
position: absolute;
z-index: 10;
top: 50%;
left: 0;
width: 100%;
text-align: center;
opacity: 0.5;
}

`
}}
